    return (
      <>
        <h1>Hello, </h1>
        <h2>My name is : {props.name}, and I am {props.age} yo. </h2>
      </>
    )
  }

  return (
    <div className="App">
      <User name='Mohamed' age='22' />
    </div>
  );
}

export default App;
